import { useHistory } from "react-router-dom";
const Legends = () => {
return (
    <div className="legend">
        <h1 font={24} style={{marginTop:"-15rem"}}>Legenda începutului zborului</h1>
        <p2>Icar este fiul lui Dedal, prezentat în mitologia greacă drept arhitect și sculptor, cel care a contribuit la ridicarea celebrului labirint din Knossos. În acest labirint regele Cretei, Minos, îl închisese pe Minotaur.</p2>
    </div>
);
}
export default Legends;
